import { Component } from "react";
import api from "./OpenAI";

export default class OpenAINLP extends Component {
    state = {
        petNames: [],
    }
    api = api;

    componentDidMount() {
      this.api.get("health-check").then(res => {
        const health = res.data;
        this.setState({ health });
      })
    }

    // constructor(props) {
    //     super(props);
    //     this.api = api;
    // }

    getPetNames(specie) {
        return this.api
        .post("nlp-pet-name",{
          specie: specie
        })
        .then((response) => response.data)
        .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
        });
    }

    getHealthCheck() {
      return this.api
        .get("health-check")
        .then((response) => response.data)
        .catch((err) => {
          console.error("ops! ocorreu um erro" + err);
        });
    }
}
